import { useSelector } from "react-redux";
import {personalInfoSelector} from "../ProfileBuilder/PersonalInfo/selector";
import {resumeBuilderSelector} from "../ProfileBuilder/ResumeBuilder/selector";
import {preferenceSelector} from '../ProfileBuilder/Preference/selector';
import Registration from './registration';
import Emergency from "./emergency";
import References from "./references";
import ResumeUpload from "./resumeUpload";
import Categories from "./categories";
import Certifications from "./certifications";
import EducationLevel from "./educationLevel";
import Specialities from "./specialities";
import Emrehr from "./emrehr";
import Shifts from "./shifts";
import TravelDistance from "./travelDistance";
import PrefferedWorkdays from "./prefferedWorkdays";
import Holiday from "./holiday";
import Covid from "./covid";
export default () => {
    const {data} = useSelector(personalInfoSelector);
    const { workHistory, data: resumeData, education, categories, certifications, educationLevel, specialities, emrehr } = useSelector(resumeBuilderSelector);
    const {preferredShifts, travelDistance, preferredWorkDays, holidayPreference, vaccination} = useSelector(preferenceSelector);
    return(
            <div className={"row"}>
                <div className={"col-12"}>
                    <div className={"card"}>
                        <div className="card-header border-bottom-0">
                            <h3 className="card-title">Profile Builder</h3>
                        </div>
                        <div className={"card-body"}>
                            <div id={"ReviewPage"}>
                                <Registration {...data}/>
                                <Emergency {...data}/>
                                <References {...data}/>
                                <ResumeUpload {...resumeData} workHistory={workHistory} education={education} />
                                <Categories {...categories}/>
                                <Certifications {...certifications}/>
                                <EducationLevel educationLevel={educationLevel} />
                                <Specialities specialities={specialities}/>
                                <Emrehr {...emrehr} />
                                <Shifts preferredShifts={preferredShifts}/>
                                <TravelDistance travelDistance={travelDistance}/>
                                <PrefferedWorkdays preferredWorkDays={preferredWorkDays} />
                                <Holiday {...holidayPreference} />
                                <Covid vaccination={vaccination}/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
    )
}
